const CardsMean = [
    {
        id: 0,
        title: "Отдых",
        img: Card1img,
    },
    {
        id: 1,
        title: "Бизнес",
        img: Card2img,
    },
    {
        id: 2,
        title: "Банкеты",
        img: Card1img,
    },
    {
        id: 3,
        title: "Здоровье",
        img: Card2img,
    }
]

export {CardsMean};
